import { getMe } from "../api";

const Profile = (props) => {
const [myProfile, setMyProfile] = useState([])

    useEffect(() => {
        getMe().then(result=>{
          setMyProfile(result.data)
          console.log(result.data)
        }).catch(error=>{
          console.error(error)
        })}, []); 
    return (
        <div>
        <h1>Profile</h1>
        <div>
        <p>messages</p>
        {myProfile.messages ? myProfile.messages.map(messages => 
        <div key ={"message" + messages.post._id}>
            <p>{messages.content}</p>
            </div>):
        <p>no messages</p>}
        </div>
        </div>
    )
}


export default Profile
